import React, { useState, useEffect } from 'react'
import Stars from '../Stars/Stars'

import "./modal.css"

const Modal = ({active, setActive}) => {
    const [viewOptions, setViewOptions] = useState('')
    const [disable, setDisable] = useState(false);
    
    // function findOption(select) {
    //     const option = select.querySelector(`option[value="${select.value}"]`)
    //     if(option === 1){
    //         setDisable(false)
    //     }
    //     else{
    //         setDisable(true)
    //     }
    //  }

  return (
    <div className={active ? "modal active" : "modal"}>
        <div className="modal__content">
        <a onClick={() => setActive(false)}><img src="https://img.icons8.com/ios-glyphs/30/000000/delete-sign.png" /></a>
            <h1>Оцени свои навыки</h1>
            <form action="">
                <div className="modal_select">
                    <h3>Выбрать навык</h3>
                    {/* Skills */}
                    <div className="select-wrapper">
                        <select onchange={() => findOption(this)} name="skill" id='skill' className='form_select'>
                            <option value='1' disabled selected>Выбери навык:</option>
                            <option value='2'>Базы данны</option>
                            <option value='3'>Клиентский веб</option>
                            <option value='4'>Серверная часть</option>
                            <option value='5'>Десктопная разработка</option>
                            <option value='6'>Мобильная разработка</option>
                            <option value='7'>Компьютерное зрение/машинное обучение</option>
                        </select>
                    </div>
                    <h3 className='lang_h3'>Выбрать язык</h3>
                    {/* Languages */}
                    <div className="select-wrapper">
                        <select onchange={() => findOption(this)} name="lang" id='lang' className='form_select'>
                            <option value='1' disabled selected>Выбери язык:</option>
                            {/* DataBase */}
                            <option value="2">PostgreSQL</option> 
                            <option value="3">MySQL</option>

                            {/* FrontEnd */}

                            <option value="4">Vue.js</option>
                            <option value="5">jQuery</option>

                            {/* BackEnd */}

                            <option value="6">PHP</option>
                            <option value="7">Laravel</option>
                            <option value="8">Node.js</option>

                            {/* Desctop */}
                            <option value="9">C#</option>
                            <option value="10">WPF</option>
                            <option value="11">Windows Forms</option>

                            {/* Mobile Dev */}

                            <option value="12">Cordova</option>
                            <option value="13">Xamarin</option>

                            {/* PC vision */}

                            <option value="14">C++</option>
                            <option value="15">OpenCV</option>
                            <option value="16">Python</option>
                            <option value="17">TenserFlow</option>
                        </select>
                    </div>
                    <div className="stars">
                        <Stars />
                    </div>
                </div>
                <div className="modal_form">
                    <div className={disable ? "form-button_disabled" : "form-button"}>
                        <button disabled={disable} type="submit">Отправить</button>
                    </div>
                </div>
            </form>
        </div>
    </div>
  )
}

export default Modal
